import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Home from './componets/Telainicial/home'
import TelaCadastroCliente from './componets/CadastroCliente/cadastrocliente'
import TelaCadastroInstrumento from './componets/CadastroCliente/cadastroinstrumento'


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/*' element={<Home/>} />
        <Route path='/cadastroinstrumento' element={<TelaCadastroInstrumento/>}/>
        <Route path = '/cadastrocliente' element={TelaCadastroCliente}/>
      </Routes>
    </BrowserRouter>
  );
}


export default App;
